import gql from 'graphql-tag'

// this looks the same as externalErc721AwardFragment but due to the way Apollo caches and the way
// graphql works, this is unique from externalErc721AwardFragment
export const timeTravelExternalErc721AwardFragment = gql`
  fragment timeTravelExternalErc721AwardFragment on ExternalErc721Award {
    id
    address
    tokenIds
  }
`
